import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <ul>
        <li><Link to="/">Ana Sayfa</Link></li>
        <li><Link to="/ik-politikasi">İK Politikası</Link></li>
        <li><Link to="/genel-basvuru">Genel Başvuru</Link></li>
        <li><Link to="/staj-basvuru">Staj Başvuru</Link></li>
        <li><Link to="/ups">UPS</Link></li>
        <li><Link to="/cozumler">Çözümler</Link></li>
        <li><Link to="/iletisim">İletişim</Link></li>
      </ul>
    </nav>
  );
}
export default Navbar;
